theme_mods.custom_css_string:
/* header-logo-width 
=========================*/
.aux-logo-header .aux-logo-anchor{ max-width:80px; }
/* header-logo-max-height-type 
=========================*/
.aux-logo-header .aux-logo-anchor > img { max-height:85px; }
/* site-body-background-size 
=========================*/
body { background-size:auto; }
/* site-body-background-repeat 
=========================*/
body { background-repeat:no-repeat; }
/* site-body-background-position 
=========================*/
body { background-position:left top; }
/* site-body-background-attach 
=========================*/
body { background-attachment:scroll; }
/* site-frame-background-color 
=========================*/
@media screen and (min-width: 700px) { .aux-framed .aux-side-frames, body.aux-framed:after,
            .aux-framed .aux-side-frames:before, .aux-framed .aux-side-frames:after{ background-color:#111111; } }
/* site-header-container-height 
=========================*/
.site-header-section .aux-header-elements:not(.aux-vertical-menu-elements), .site-header-section .aux-fill .aux-menu-depth-0 > .aux-item-content { height:85px; }
/* site-transparent-header-bgcolor 
=========================*/
.site-header-section { background-color:#FFFFFF; }
/* site-header-container-scaled-height 
=========================*/
.aux-top-sticky .site-header-section.aux-sticky .aux-fill .aux-menu-depth-0 > .aux-item-content, .aux-top-sticky .site-header-section.aux-sticky .aux-header-elements,.aux-elementor-header.aux-sticky .elementor-section-wrap > .elementor-section { height:80px; }
/* sticky-header-color 
=========================*/
.site-header-section.aux-sticky, .aux-elementor-header.aux-sticky .elementor-section-wrap > .elementor-section { background-color:#FFFFFF; }
/* site-vertical-menu-background-color 
=========================*/
.aux-vertical-menu-side  { background-color:#FFF; }
/* site-header-navigation-item-height 
=========================*/
.site-header-section .aux-middle .aux-menu-depth-0 > .aux-item-content { height:60px; }
/* site-mobile-header-toggle-button-color 
=========================*/
.site-header-section .aux-header .aux-burger:before, .site-header-section .aux-header .aux-burger:after, .site-header-section .aux-header .aux-burger .mid-line{ border-color:#3d3d3d; }
/* site-menu-full-screen-background-color 
=========================*/
#fs-menu-search:before { background-color:rgba(255, 255, 255, 0.95); }
/* site-top-header-background-color 
=========================*/
#top-header{background-color:#FFFFFF;}
/* post-title-bar-overlay-pattern-opacity 
=========================*/
.single-post .aux-overlay-bg-hash::before { opacity:0.15; }
/* page-title-bar-overlay-pattern-opacity 
=========================*/
.page .aux-overlay-bg-hash::before { opacity:0.5; }
/* subfooter-bar-layout-bg-color 
=========================*/
.aux-subfooter-bar { background-color:#fafafa; }
/* subfooter-bar-top-border-color 
=========================*/
.aux-subfooter-bar { border-top:1px solid #EAEAEA; }
/* subfooter-layout-bg-image-position 
=========================*/
.aux-subfooter{background-position:center center;}
/* subfooter-layout-bg-image-size 
=========================*/
.aux-subfooter{background-size:cover;}
/* subfooter-layout-bg-image-repeat 
=========================*/
.aux-subfooter{background-repeat:no-repeat;}
/* subfooter-top-border-color 
=========================*/
.aux-subfooter { border-top:1px solid #EAEAEA; }
/* site-footer-bg-color 
=========================*/
.aux-site-footer{background-color:#1A1A1A;}
/* footer-top-border-color 
=========================*/
.aux-site-footer{border-top:1px solid #EAEAEA;}
/* footer-top-border-width 
=========================*/
.aux-site-footer { border-top-width:1px; }
/* site-secondary-logo-max-height 
=========================*/
.aux-logo-footer .aux-logo-anchor img { max-height:50px; }
/* site-body-background-color 
=========================*/
body { background-color:#0f0f0f; }
/* site-content-background-color 
=========================*/
.aux-top-header, .aux-sticky-footer .page-title-section, .aux-sticky-footer #main, #inner-body{background-color:#0f0f0f;}
/* portfolio-title-bar-overlay-pattern-opacity 
=========================*/
.single-portfolio .aux-overlay-bg-hash::before { opacity:0.5; }
/* portfolio-classic-entry-box-background-color 
=========================*/
.post-type-archive-portfolio .aux-entry-boxed .entry-main { background-color: #FFFFFF; }
/* portfolio-classic-entry-box-border-color 
=========================*/
.post-type-archive-portfolio .aux-entry-boxed .entry-main { border-color: #EAEAEA !important; }
/* portfolio-land-side-background-color 
=========================*/
.post-type-archive-portfolio .aux-item-land .aux-land-side { background-color: #FFFFFF; }
/* portfolio-land-side-border-color 
=========================*/
.post-type-archive-portfolio .aux-item-land .aux-land-side { border-color: #EAEAEA !important; }
/* blog-post-share-button-icon-size 
=========================*/
.single-post .aux-single-post-share span::before { font-size:10px; }
/* portfolio-single-share-button-icon-size 
=========================*/
.single-portfolio .aux-single-portfolio-share span::before { font-size:10px; }
/* site-featured-color-1 
=========================*/
:root{--auxin-featured-color-1: #ffffff;}
/* site-featured-color-2 
=========================*/
:root{--auxin-featured-color-2: rgba(255, 255, 255, 0.6);}
/* site-featured-color-3 
=========================*/
:root{--auxin-featured-color-3: #f8b339;}
/* site-featured-color-4 
=========================*/
:root{--auxin-featured-color-4: #0f0f0f;}
/* body-typography 
=========================*/
body{ font-family:'Lato'; } 
/* general-heading-h1 
=========================*/
body h1, body .aux-h1{ font-family:'Poppins'; } 
/* general-heading-h2 
=========================*/
body h2, body .aux-h2{ font-family:'Poppins'; } 
/* general-heading-h3 
=========================*/
body h3, body .aux-h3{ font-family:'Poppins'; } 
/* general-heading-h4 
=========================*/
body h4, body .aux-h4{ font-family:'Poppins'; } 
/* general-heading-h5 
=========================*/
body h5, body .aux-h5{ font-family:'Poppins'; }

